@Jefferson Pereira pode ser tbm só uma coincidência esses vírus aparecerem agora, até por causa das mudanças climáticas, as florestas estão desaparecendo e os animais vão tentar a vida em um habitat não apropriado, então transmite doenças aos humanos. 

Vi uma matéria que falava que o Coronavírus surgiu pq os morcegos estavam em uma feira e acabaram mordiscando frutas e deixaram lá, aí as pessoas sem perceber acabaram comendo essas frutas. 
Vc tem outra teoria??

